import React from 'react';
import './Form.css';

const FormSuccess = () => {
  return (
    <div className='form-content-right'>
      <h1 className='form-success'>¡Tu cuenta ha sido creada éxitosamente!</h1>
      <img className='form-img-2' src='https://cdni.iconscout.com/illustration/premium/thumb/success-2081676-1756040.png' alt='success' />
    </div>
  );
};

export default FormSuccess;
